  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0144244 includes Surface
  underway data collected from MELVILLE in the South Pacific Ocean from 2010-01-05
  to 2010-02-11. These data include AIR TEMPERATURE, AIR-SEA DIFFERENCE - PARTIAL
  PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, BAROMETRIC PRESSURE, Partial pressure
  (or fugacity) of carbon dioxide - atmosphere, Partial pressure (or fugacity) of
  carbon dioxide - water, SALINITY, SEA SURFACE TEMPERATURE, WIND DIRECTION and WIND
  SPEED. The instruments used to collect these data include Carbon dioxide (CO2) gas
  analyzer and Shower head chamber equilibrator for autonomous carbon dioxide (CO2)
  measurement.nnThese data were collected by Rik Wanninkhof of US DOC; NOAA; OAR;
  Atlantic Oceanographic and Meteorological Laboratory as part of the P06_2010_Underway
  data set. CDIAC associated the following cruise ID(s) with this data set: 318M20100105nnThe
  International CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries
  out a systematic and global re-occupation of select WOCE/JGOFS hydrographic sections
  to quantify changes in storage and transport of heat, fresh water, carbon dioxide
  (CO2), and related parameters.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
